import React, { Component } from 'react'

class Demo extends Component {

    constructor(props) {
        super(props)
    
        this.state = {
             msg: 'Welcome Visitors'
        }
    }
    
    subscribe(){
        this.setState({
           msg: 'Thank you users'   
        })
    }

    render() {
        return (
            <>
           <h1>{this.state.msg}</h1>
           <button onClick={() => {this.subscribe()}}>Subscribe</button>
           </>
        )
    }
}

export default Demo
